INSERT INTO `v1_889d51f3cbfd84b485bd8f76571582386b2ff82a9f22587a13d98f01aa7395d7` VALUES (76020004, 9, "バトル開始時、すべてのキャラのＨＰ吸収を特大ダウンさせる。", "ＨＰ吸収ダウン", 602000405);
INSERT INTO `v1_889d51f3cbfd84b485bd8f76571582386b2ff82a9f22587a13d98f01aa7395d7` VALUES (76020004, "boss_tp_down_cut", "バトル開始時、すべてのモンスターがＴＰダウン\n50％カット状態になる。", "ＴＰダウンカット", 602000406);
INSERT INTO `v1_889d51f3cbfd84b485bd8f76571582386b2ff82a9f22587a13d98f01aa7395d7` VALUES (76020005, 18, "すべてのモンスターが一度の行動で受けるダメージ値を減衰させる。ダメージ値が上昇するほど減衰率も上昇する。", "ダメージ減衰", 602000501);
INSERT INTO `v1_889d51f3cbfd84b485bd8f76571582386b2ff82a9f22587a13d98f01aa7395d7` VALUES (76020005, 17, "バトル開始時、すべてのキャラのＴＰ上昇の上限値を150にする。", "ＴＰ上昇上限付与", 602000502);
