INSERT INTO `v1_889d51f3cbfd84b485bd8f76571582386b2ff82a9f22587a13d98f01aa7395d7` VALUES (76020005, 9, "バトル開始時、すべてのキャラのＨＰ吸収を特大ダウンさせる。", "ＨＰ吸収ダウン", 602000505);
INSERT INTO `v1_889d51f3cbfd84b485bd8f76571582386b2ff82a9f22587a13d98f01aa7395d7` VALUES (76020005, "boss_tp_down_cut", "バトル開始時、すべてのモンスターがＴＰダウン\n50％カット状態になる。", "ＴＰダウンカット", 602000506);
